import React, { useState } from "react";
import { InputSearch } from "..";
import { getImageSearch } from '../../api/appi'
import { ImgCard } from "..";

const ImgList = () => {
    const [images, setImages] = useState([]);


    const imageSearch = (value) => {
        getImageSearch(value).then(result => setImages(result))
    };

    // console.log(images);

    return (
        <div>
            <InputSearch imageSearch={ imageSearch } />
            { images && images.map(image => <ImgCard image={ image } key={ image.id } />)}
        </div>
    )
}

export default ImgList;
